import React from 'react';
import "../hojas-de-estilo/Articulos.css";


function Articulos(cantidad){
  let items = cantidad;
  return(
    <div className='con_articulos'>
      <div className='con_articulos_titulo'>
        <span>Cart</span>
      </div>
      <div className='con_articulos_lista'>
        {items?<div className='empty'><span>Your cart is empty.</span></div>:<div className='empty'><span>hay {items} elementos</span></div>
        }
        
        
      </div>
    </div>
  );
}

export default Articulos;
